$(document).ready(function(){if($("#home-vid").length){var o=$("#home-vid");o.on("canplaythrough",function(){o[0].play()})}$(".offcanvas-toggle, .offcanvas-dismiss").on("click",function(){$(".offcanvas-toggle").toggleClass("offcanvas-toggle--active"),$(".offcanvas").toggleClass("offcanvas--active")}),$(".popup-toggle").on("click",function(o){o.preventDefault();var a=$(this),n=$(a.attr("data-popup-target"));n.addClass("popup--show").find(".popup__dismiss").on("click",function(o){o.preventDefault(),n.removeClass("popup--show").one("transitionend",function(){n.trigger("popup-close")})})})});